import React from 'react'
import data from "./data"
import "./products.css"

export const Products = () => {
    return (
        <div className='container'>
            {
                data.map((product) => {
                    return (
                            <div className='cart' key={product.id}>
                                <div>
                                    <img src={product.thumbnail} alt="product" style={{ width: "50%" }} />
                                </div>
                                <div>
                                    <p>{product.title}</p>
                                    <p>Rs {product.price}</p>
                                </div>
                            </div>
                    )
                })
            }
        </div>
    )
}
